import React from "react";
import Img_3 from "./img-3.svg";
import Img_4 from "./img-4.svg";
import Card from "./Card";
const Service = () => {
  let title1 = "Web Dev";
  let title2 = "App Dev";
  let title3 = "Mob Dev";
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card img={Img_3} title={title1} />
              <Card img={Img_4} title={title2} />
              <Card img={Img_3} title={title3} />
              <Card img={Img_3} />
              <Card img={Img_3} />
              <Card img={Img_3} />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Service;
